  const [gameState, setGameState] = useState(newGame.gameState);
  console.log(gameState.board);

  return (
    <div>
      {gameState.board.boardState.map((tile) => {
        <li>{tile.number}</li>;
      })}
    </div>
  );
};

export default Game;
